TUTORIAL_CLOSE:"Got it!",CHANNEL_MUTE_TOOLTIP:"\nMuting a channel prevents unread indicators and notifications from appearing unless you are mentioned.\n  ",SHOW_MUTED:"Show {n} Muted",HIDE_MUTED:"Hide {n} Muted",WELCOME_MESSAGE_OWNER_TITLE:"Welcome to your server, {username}!",WELCOME_MESSAGE_TITLE:"Welcome to the server, {username}!",WELCOME_MESSAGE_INSTANT_INVITE:"\n**Invite your friends** to this server by clicking on a [share button](onShareClick) when you're ready.\n  ",WELCOME_MESSAGE_DESKTOP_APPS:"\n**Download** the [desktop app](onDownloadClick) for system-wide Push to Talk, lower CPU and bandwidth usage, and more.\n  ",WELCOME_MESSAGE_TUTORIAL:"**Learn about Discord** at your own pace by exploring the floating quest indicators.",WELCOME_MESSAGE_MOBILE_APPS:"\n**Stay connected** to your server from [your smartphone](onDownloadClick) and even use Discord while console gaming.\n  ",WELCOME_MESSAGE_SUPPORT:"\n**Reach us** via [our help desk]({supportURL}) or on Twitter [@discordapp]({twitterURL}) if you have any\nquestions or need help.\n  ",TIP_VOICE_CONVERSATIONS_TITLE:"Raise Your Voice",TIP_VOICE_CONVERSATIONS_BODY:"\nThis is your **voice control panel.**\n\nUse these buttons to unmute your microphone, deafen your headphones, or modify settings.\nYou can adjust your speaking mode from **Voice Activity to Push To Talk** by clicking the cog.\n  ",TIP_WRITING_MESSAGES_TITLE:"Have a Conversation",TIP_WRITING_MESSAGES_BODY:"\nThis is where you'll be typing all your opinions and ideas.\n\nTo keep things fancy we've included Markdown syntax support so you can **make a point** or\n__stomp your feet.__ You can also **drag & drop** images or files right here to quickly\nshare those cat GIFs. Not too many though.\n",TIP_ORGANIZE_BY_TOPIC_TITLE:"Organize by Channels",TIP_ORGANIZE_BY_TOPIC_BODY:"\n**Text channels** let you separate your chat conversations by topic. You can hop around\nchannels easily and even **@mention** friends to send notifications to their desktop or phone.\n\n**Voice Channels** let you separate your conversations into groups as big or small as you’d like.\nClick on a channel to join a conversation. You’ll stay in that Voice Channel even if you switch\ntext channels too!\n",TIP_WHOS_ONLINE_TITLE:"What're You Playing?",TIP_WHOS_ONLINE_BODY:"\nThis list shows who's in the current channel.\n\nAnyone using the desktop apps will also show what game they're currently playing. Clicking on a\nuser will reveal **individual settings** like volume controls or admin controls.\n",TIP_INSTANT_INVITE_TITLE:"Invite Your Friends",TIP_INSTANT_INVITE_BODY:"\nMouse over any text or voice channel to reveal the share button. Use the generated link to invite\npeople directly into the chosen channel.\n\nAdvanced Invite Links allow you to set usage restrictions such as how many people can join with that\nlink, how long it lasts, or even making it human readable for easier sharing via non-clickable game chat.\n",TIP_SERVER_SETTINGS_TITLE:"Control Your Server",TIP_SERVER_SETTINGS_BODY:"\nClick here to access your server's settings.\n\nYou can modify all sorts of things like permissions and roles, choose your voice server region,\nsetup an AFK channel, manage invite links, manage banned users, or even delete your server entirely.\n",TIP_DIRECT_MESSAGES_TITLE:"Start a Private Conversation",TIP_DIRECT_MESSAGES_BODY:"\nSee everyone across all of your servers from this list.\n\nYou can have a private one-on-one chat conversation by choosing a friend and chatting away!\nDirect Messages are great for reaching people via notifications even when they're AFK.\n",TIP_CREATE_MORE_SERVERS_TITLE:"Servers Everywhere!",TIP_CREATE_MORE_SERVERS_BODY:"\nClick this plus button to create a new server.\n\nBecause servers are free, you can create as many as you want. Each server lets you have a unique\nplace for different groups of people. You can delete servers too if you no longer need it.\n",TIP_CREATE_FIRST_SERVER_TITLE:"Create Your Own Server",TIP_CREATE