VITE_BODY:'Mueve el cursor a cualquier canal de texto o canal de voz para revelar el botón de compartir. Usa el enlace generado para invitar gente directamente al canal seleccionado.\n\nLos "Enlaces avanzados para invitar" le permiten poner sus propias restricciones tales como cuanta gente puede unirse con ese enlace, la duración del enlace, o incluso hacerlo fácil de leer compartiéndolo vía un chat no clickeable.',TIP_SERVER_SETTINGS_TITLE:"Controla tu Servidor",TIP_SERVER_SETTINGS_BODY:"Haz clic aquí para acceder a la configuración de tu servidor.\n\nPuedes modificar todo tipo de cosas, como los permisos y roles, escoger la región del servidor de voz, crear un canal para los usuarios inactivos, administrar los enlaces de invitación, administrar los usuarios suspendidos, o incluso borrar tu servidor por completo.",TIP_DIRECT_MESSAGES_TITLE:"Iniciar una conversación privada",TIP_DIRECT_MESSAGES_BODY:'Ve quiénes están en tus servidores desde esta lista,\n\n¡Puedes tener una conversación privada seleccionando a un amigo y empezando a chatear!\nLos "Mensajes Directos" son una excelente manera de contactar con gente a través de las notificaciones, incluso si están inactivos.',TIP_CREATE_MORE_SERVERS_TITLE:"¡Servidores en todas partes!",TIP_CREATE_MORE_SERVERS_BODY:"Haz click en este botón '+' para crear un nuevo servidor.\n\nComo los servidores son gratuitos, puedes crear tantos como quieras. Cada servidor te permite tener un lugar único para diferentes grupos de personas. También puedes eliminar los servidores si no los necesitas más.",TIP_CREATE_FIRST_SERVER_TITLE:"Crea tu propio servidor",TIP_CREATE_FIRST_SERVER_BODY:"",TIP_FRIENDS_LIST_TITLE:"Ver a tus amigos",TIP_FRIENDS_LIST_BODY:"Haz clic aquí para ver tus mensajes directos y ver el estado de todas las personas en tus servidores. \n\nCuando recibas un MD, aparecerá debajo de tu avatar para facilitar el acceso.",BAN_CONFIRM_TITLE:"Aplastar a '{username}' con el martillo bloqueador",FORM_LABEL_DELETE_MESSAGE_HISTOR